B.ZO=new A.at("1. INTRODUCCI\xd3N\nBienvenido/a a Carpinter\xeda Chavarr\xeda. Estos T\xe9rminos y Condiciones regulan el acceso y uso de nuestros servicios, productos y plataforma. Al realizar un pedido o usar nuestros servicios, aceptas estos t\xe9rminos.\n\n2. SOBRE NOSOTROS\nCarpinter\xeda Chavarr\xeda fabrica muebles personalizados, realiza restauraci\xf3n de madera y ofrece servicios de carpinter\xeda con m\xe1s de 15 a\xf1os de experiencia.\n\n3. SERVICIOS OFRECIDOS\n- Muebles personalizados\n- Restauraci\xf3n\n- Venta de productos terminados\n- Instalaci\xf3n y entregas\n\n4. PEDIDOS Y CONTRATACI\xd3N\nTodo pedido requiere el 50% de adelanto. Se entrega el saldo restante al finalizar. Los pedidos personalizados no pueden cancelarse una vez iniciada la producci\xf3n.\n\n5. PLAZOS DE ENTREGA\nLos plazos se informan al confirmar el pedido. Puede haber demoras externas como materiales o clima.\n\n6. POL\xcdTICA DE CANCELACI\xd3N Y DEVOLUCI\xd3N\n- No se cancelan pedidos personalizados.\n- Devoluciones: solo productos est\xe1ndar, dentro de los 5 d\xedas.\n- Productos da\xf1ados: se reparan o reemplazan sin costo.\n\n7. GARANT\xcdA\n6 meses por defectos de fabricaci\xf3n, no incluye mal uso o da\xf1os por clima.\n\n8. PROPIEDAD INTELECTUAL\nTodos los dise\xf1os, logotipos y textos pertenecen a Carpinter\xeda Chavarr\xeda.\n\n9. PROTECCI\xd3N DE DATOS\nTus datos se usan solo para gestionar pedidos, cumpliendo las leyes vigentes.\n\n10. LIMITACI\xd3N DE RESPONSABILIDAD\nNo nos responsabilizamos por da\xf1os indirectos. La responsabilidad m\xe1xima es el valor del producto.\n\n11. JURISDICCI\xd3N\nEste acuerdo se rige por las leyes locales. Toda controversia se resolver\xe1 en tribunales del domicilio de Carpinter\xeda Chavarr\xeda.\n\nCONTACTO:\nEmail: contacto@carpinteriachavarria.com\nWhatsApp: +XX XXX XXX XXXX\nDirecci\xf3n: Calle Ficticia 123, Ciudad Carpinter\xeda, Pa\xeds.\n",null,B.XM,B.fN,null,null,null,null,null)
